import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
//import hospitalImage from '../images/hospital.jpg'; // Import vaše slike bolnice

function ContactUsPage() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [subject, setSubject] = useState('');
  const [message, setMessage] = useState('');
  const [submitMessage, setSubmitMessage] = useState('');

  // Mock podaci za kontakt informacije
  const contactInfo = {
    address: 'Ulica Uzorita 10, 71000 Sarajevo, Bosna i Hercegovina',
    phone: '+387 33 123 456',
    email: 'info@winxcare.com',
    workingHours: 'Ponedjeljak - Petak: 08:00 - 17:00'
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Ovdje biste obično poslali podatke forme na backend.
    // Za sada, samo simuliramo slanje.
    console.log('Contact form submitted:', { name, email, subject, message });
    setSubmitMessage('Vaša poruka je uspješno poslana! Javit ćemo vam se uskoro.');
    // Resetuj formu
    setName('');
    setEmail('');
    setSubject('');
    setMessage('');
  };

  return (
    <div className="container my-5">
      <div className="card shadow-lg p-4">
        <div className="card-body">
          <h2 className="card-title text-center mb-4 text-danger">Contact Us</h2>
          <p className="text-center text-muted mb-5">
            Imate pitanje ili vam je potrebna pomoć? Slobodno nam se obratite putem forme ispod.
          </p>

          <div className="row mb-5 align-items-center">
            <div className="col-md-6">
              {/* Koristimo uvezenu sliku hospitalImage */}
              <img src={hospitalImage} alt="WinxCare Clinic" className="img-fluid rounded shadow-sm mb-3 mb-md-0" />
            </div>
            <div className="col-md-6">
              <h4 className="text-danger mb-3">Our Information</h4>
              <p className="text-muted mb-1"><strong>Address:</strong> {contactInfo.address}</p>
              <p className="text-muted mb-1"><strong>Phone:</strong> {contactInfo.phone}</p>
              <p className="text-muted mb-1"><strong>Email:</strong> {contactInfo.email}</p>
              <p className="text-muted mb-1"><strong>Working Hours:</strong> {contactInfo.workingHours}</p>
            </div>
          </div>

          <hr className="my-5" />

          <h3 className="text-center mb-4 text-dark">Send Us a Message</h3>
          {submitMessage && (
            <div className="alert alert-success text-center mb-4" role="alert">
              {submitMessage}
            </div>
          )}
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label htmlFor="nameInput" className="form-label">Your Name</label>
              <input
                type="text"
                className="form-control"
                id="nameInput"
                placeholder="Full Name"
                value={name}
                onChange={(e) => setName(e.target.value)}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="emailInput" className="form-label">Email address</label>
              <input
                type="email"
                className="form-control"
                id="emailInput"
                placeholder="name@example.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="subjectInput" className="form-label">Subject</label>
              <input
                type="text"
                className="form-control"
                id="subjectInput"
                placeholder="Subject of your message"
                value={subject}
                onChange={(e) => setSubject(e.target.value)}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="messageTextarea" className="form-label">Your Message</label>
              <textarea
                className="form-control"
                id="messageTextarea"
                rows="5"
                placeholder="Type your message here..."
                value={message}
                onChange={(e) => setMessage(e.target.value)}
                required
              ></textarea>
            </div>
            <div className="d-grid gap-2">
              <button type="submit" className="btn btn-danger btn-lg">Send Message</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default ContactUsPage;
